info=[]
for element in element_info:

    name = element.find('h5', class_='card-header').text.strip()
    firm = element.find('p', class_='card-text').text.strip()
    address = element.find('p', class_='card-text').find_next_sibling('p').text.strip()
    phone = element.find('p', class_='card-text').find_next_sibling('p').find_next_sibling('p').text.strip()
