    emails = [email_link['href'].replace('mailto:', '') for email_link in email_links if email_link['href'].startswith('mailto:')]
    emails_string = ", ".join(emails)

    people_info={
        "Name":name,
        "Firm":firm,
        "Address":address,
        "Phone":phone,
        "Email":emails_string
    }
    print(people_info)
    info.append(people_info)

